import Navigation from './components/navigation';
import { BrowserRouter as Router, Route,Switch } from "react-router-dom";

function App() {
  return (
    <div>
      <Router>

      <Navigation />

      <Switch>
      <Route path="/:type/:id">
        <PetDetailsPage/>
      </Route>


      <Route path="/:type?">
      <HomePage />
      </Route>

      <Route path="/search">

      </Route>
      </Switch>



      </Router>
    </div>
  );
}

export default App;
